import React, { useState, useEffect } from "react";
import { Layout } from "../components/Layout/Layout";
import Carousel from "../components/Carousel";

const HomePage = () => {
  return (
    <Layout>
      <div className="p-2 items-center">
        {/* Carousel */}
        <Carousel />
      </div>
    </Layout>
  );
};

export default HomePage;
